import React from "react";


const Aboutus = () => {
  return (
    <>
            <div className="service-first-outer">
        <div className="service-first-inner">
            <div className="service-first-inner-child">
                <div className="text">
                    <p>
                        <strong>about us</strong>
                        <span>
                            <a href="index.html">Home</a>
                            <a href="#">about us</a>
                        </span>
                    </p>
                </div>
            </div>
        </div>
    </div>

    </>
  );
};      


export default Aboutus;
